import React from 'react'
function add (a,b)
{
    let sum=a+b;
    return sum;
}
function sub (a,b)
{
    let sum=a-b;
    return sum;
}
function mul (a,b)
{
    let sum=a+b;
    return sum;
}
function div (a,b)
{
    let sum=a+b;
    return sum;
}
const Calculater = () => {
  return (
    <>
      <ul>
          <li>Sum of two no is {add(10,20)} </li>
          <li>Subtract of two no is {sub(10,5)}</li>
          <li>Multiply of two no is {mul(10,5)} </li>
          <li>Division of two no is {div(4,2)}</li>
      </ul>
    </>
  )
}

//export default Calculater
export {add,mul,sub,div};
